  "translationLines": [
    {
      "lineNumber": 96641,
      "originalJapaneseLine": "「いえ、でも……確かにそうですね……",
      "translatedEnglishLine": "\"No, but... that's certainly true...\""
    },
    {
      "lineNumber": 96642,
      "originalJapaneseLine": "　努力、してみます」",
      "translatedEnglishLine": "I'll try to put in the effort.\""
    },
    {
      "lineNumber": 96643,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 96644,
      "originalJapaneseLine": "「恐縮です」",
      "translatedEnglishLine": "\"I'm humbled.\""
    },
    {
      "lineNumber": 96645,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........."
    },
    {
      "lineNumber": 96646,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 96647,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 96648,
      "originalJapaneseLine": "部屋から出たトルストイが",
      "translatedEnglishLine": "Tolstoi, who had left the room,"
    },
    {
      "lineNumber": 96649,
      "originalJapaneseLine": "ガリガリと頭を掻く。",
      "translatedEnglishLine": "scratched his head anxiously."
    },
    {
      "lineNumber": 96650,
      "originalJapaneseLine": "「やれやれ……」",
      "translatedEnglishLine": "\"Good grief...\""
    },
    {
      "lineNumber": 96651,
      "originalJapaneseLine": "「貧乏くじ、また引かされたな……」",
      "translatedEnglishLine": "\"I've drawn the short straw again...\""
    },
    {
      "lineNumber": 96652,
      "originalJapaneseLine": "「よく言うぜ」",
      "translatedEnglishLine": "\"You say that a lot.\""
    },
    {
      "lineNumber": 96653,
      "originalJapaneseLine": "「ヒューバート殿」",
      "translatedEnglishLine": "\"Lord Hubert.\""
    },
    {
      "lineNumber": 96654,
      "originalJapaneseLine": "「貧乏くじは自分から引いたくせに」",
      "translatedEnglishLine": "\"You drew the short straw yourself, though.\""
    },
    {
      "lineNumber": 96655,
      "originalJapaneseLine": "「とんでもない。",
      "translatedEnglishLine": "\"Not at all."
    },
    {
      "lineNumber": 96656,
      "originalJapaneseLine": "　他に選択の余地がなかっただけです」",
      "translatedEnglishLine": "I just had no other choice.\""
    },
    {
      "lineNumber": 96657,
      "originalJapaneseLine": "「へっ……",
      "translatedEnglishLine": "\"Heh..."
    },
    {
      "lineNumber": 96658,
      "originalJapaneseLine": "　まあ、そういうことにしておくぜ」",
      "translatedEnglishLine": "Well, let's just say that.\""
    },
    {
      "lineNumber": 96659,
      "originalJapaneseLine": "「はあ、どうも……",
      "translatedEnglishLine": "\"Ah, thank you..."
    },
    {
      "lineNumber": 96660,
      "originalJapaneseLine": "　恐縮です」",
      "translatedEnglishLine": "I'm humbled.\""
    },
    {
      "lineNumber": 96661,
      "originalJapaneseLine": "「はあ……」",
      "translatedEnglishLine": "\"Ha...\""
    },
    {
      "lineNumber": 96662,
      "originalJapaneseLine": "トルストイが中庭で溜め息をついていた。",
      "translatedEnglishLine": "Tolstoi was sighing in the courtyard."
    },
    {
      "lineNumber": 96663,
      "originalJapaneseLine": "「おう」",
      "translatedEnglishLine": "\"Hey.\""
    },
    {
      "lineNumber": 96664,
      "originalJapaneseLine": "「こんにちは、トルストイさん」",
      "translatedEnglishLine": "\"Hello, Tolstoi.\""
    },
    {
      "lineNumber": 96665,
      "originalJapaneseLine": "「総統、シィルさん」",
      "translatedEnglishLine": "\"Supreme Commander, Seale.\""
    },
    {
      "lineNumber": 96666,
      "originalJapaneseLine": "「まったく、何度見ても暗い顔だな。",
      "translatedEnglishLine": "\"Really, no matter how many times I see you, you always have such a gloomy face."
    },
    {
      "lineNumber": 96667,
      "originalJapaneseLine": "　また貧乏くじがどうのと言っとったのか」",
      "translatedEnglishLine": "Were you complaining again about drawing the short straw?\""
    },
    {
      "lineNumber": 96668,
      "originalJapaneseLine": "「男の癖にグチグチとうっとうしい奴」",
      "translatedEnglishLine": "\"You're so annoying, whining like a guy.\""
    },
    {
      "lineNumber": 96669,
      "originalJapaneseLine": "「ら、ランス様……」",
      "translatedEnglishLine": "\"L-Lance-sama...\""
    },
    {
      "lineNumber": 96670,
      "originalJapaneseLine": "「はあ……これは失礼を。",
      "translatedEnglishLine": "\"Ha... My apologies for that."
    },
    {
      "lineNumber": 96671,
      "originalJapaneseLine": "　本当に気にしてるわけではありませんが、",
      "translatedEnglishLine": "I don't truly mind, but"
    },
    {
      "lineNumber": 96672,
      "originalJapaneseLine": "　いつからか口癖になってましたね」",
      "translatedEnglishLine": "it's become a habit to say it at some point.\""
    },
    {
      "lineNumber": 96673,
      "originalJapaneseLine": "「自分で選んだ癖に文句垂れるな、と……",
      "translatedEnglishLine": "\"I've been scolded by friends for complaining about something I chose myself...\""
    },
    {
      "lineNumber": 96674,
      "originalJapaneseLine": "　友人にはよく叱られたものです」",
      "translatedEnglishLine": "\"My friends often told me off for that.\""
    },
    {
      "lineNumber": 96675,
      "originalJapaneseLine": "「ふん、まあいい。",
      "translatedEnglishLine": "\"Hmph, well, whatever."
    },
    {
      "lineNumber": 96676,
      "originalJapaneseLine": "　今日は別の話で来たのだ」",
      "translatedEnglishLine": "I've come to talk about something else today.\""
    },
    {
      "lineNumber": 96677,
      "originalJapaneseLine": "「別の話ですか」",
      "translatedEnglishLine": "\"Something else?\""
    },
    {
      "lineNumber": 96678,
      "originalJapaneseLine": "「お前、俺の女達に色目を使ってるだろう！」",
      "translatedEnglishLine": "\"You're flirting with my women, aren't you!\""
    },
    {
      "lineNumber": 96679,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 96680,
      "originalJapaneseLine": "「ひどい誤解です」",
      "translatedEnglishLine": "\"That's a terrible misunderstanding.\""
    },
    {
      "lineNumber": 96681,
      "originalJapaneseLine": "「ら、ランス様……",
      "translatedEnglishLine": "\"L-Lance-sama..."
    },
    {
      "lineNumber": 96682,
      "originalJapaneseLine": "　トルストイさん、そんなことしてませんよ」",
      "translatedEnglishLine": "Tolstoi, he's not doing anything like that.\""
    },
    {
      "lineNumber": 96683,
      "originalJapaneseLine": "「む、本当か？　本当だろうな？」",
      "translatedEnglishLine": "\"Hmm, is that true? It better be true.\""
    },
    {
      "lineNumber": 96684,
      "originalJapaneseLine": "「ほ、本当です」",
      "translatedEnglishLine": "\"Y-yes, it is true.\""
    },
    {
      "lineNumber": 96685,
      "originalJapaneseLine": "「ええ。",
      "translatedEnglishLine": "\"Indeed."
    },
    {
      "lineNumber": 96686,
      "originalJapaneseLine": "　総統の懇意の女性に色目を使うなど……",
      "translatedEnglishLine": "To think of flirting with the Supreme Commander's favored women..."
    },
    {
      "lineNumber": 96687,
      "originalJapaneseLine": "　考えるだに震えてしまいますね」",
      "translatedEnglishLine": "Just the thought of it makes me shudder.\""
    },
    {
      "lineNumber": 96688,
      "originalJapaneseLine": "トルストイはボーッとした表情のまま答えた。",
      "translatedEnglishLine": "Tolstoi replied with a dazed expression."
    },
    {
      "lineNumber": 96689,
      "originalJapaneseLine": "「ふん、大体俺は部隊に俺以外の男が",
      "translatedEnglishLine": "\"Hmph, generally speaking, I can't tolerate"
    },
    {
      "lineNumber": 96690,
      "originalJapaneseLine": "　いるってこと自体、我慢ならんのだ」",
      "translatedEnglishLine": "the very idea of any other men being in the unit besides myself.\""
    }
  ]
}

